    false,nt"url": null,nt"notes": "The Lower Souris Migratory Waterfowl Refuge
    (now known as the J. Clark Salyer National Wildlife Refuge) is located just south
    of the Canadian border in North Dakota. The refuge was established and constructed
    by the CCC in 1935 to restore waterfowl habitat. This report gives an overview of
    events taking place on the refuge during November of 1935. Seed collection continued
    to take place but snow and cold weather brought difficulties. In addition, more
    muskrat houses and fish shelters were constructed and monitored. Other sections
    in this narrative include waterfowl, winter feeding, erosion, teaching and wildlife.
    The narrative concludes with photographs taken throughout the month.",nt"owner_org":
